import React, { Component } from 'react'
import Button from "./Button"

class Button_List extends React.Component{

    partner_list = ["My Partner", "My Friend", "Other"]

    getList = () => {
        return this.partner_list
    }

    getButtons = () => {
        let items = []
        for (let i of this.getList()) {
            items.push(
                <Button
                    buttonText={i}
                    width="130px"
                ></Button>
            )
        }
        return items
    }

    render() {
        const width: React.CSSProperties = {
            width: this.props.width,
        }
        return (
            <div
                className={
                    this.props.list_type == "trip_style"
                        ? "btn-list"
                        : "btn-list radio"
                }
                style={width}
            >
                {this.getButtons()}
            </div>
        )
    }
}
